import React from 'react';

function Experience() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>education & experience.</h1>

      <section style={styles.section}>
        <h2 style={styles.subtitle}>Education</h2>
        <p style={styles.text}>Bachelor of Science in Computer Science, Mathematics</p>
        <ul style={styles.list}>
          <li>Threads: Artificial Intelligence & System Architecture</li>
        </ul>
      </section>

      <section style={styles.section}>
        <h2 style={styles.subtitle}>Experience</h2>
        <p style={styles.text}><strong>Georgia Tech, Automated Algorithm Design</strong><br />Undergraduate ML Researcher</p>
        <p style={styles.text}><strong>Trading Club at Georgia Tech</strong><br />Quantitative Research Analyst</p>
        <p style={styles.text}><strong>Center for Education Integrating Science, Mathematics, and Computing (CEISMC)</strong><br />Summer Day Intern</p>
        <p style={styles.text}><strong>L&C Cabinetry</strong><br />Web Designer</p>
      </section>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '800px',
    margin: '0 auto',
    padding: '20px',
    fontFamily: 'Roboto, Arial, sans-serif',
    color: '#333',
  },
  title: {
    fontSize: '48px',
    fontWeight: 'bold',
    marginBottom: '20px',
  },
  section: {
    marginBottom: '20px',
  },
  subtitle: {
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '10px',
  },
  text: {
    fontSize: '18px',
    lineHeight: '1.6',
    marginBottom: '10px',
  },
  list: {
    fontSize: '18px',
    lineHeight: '1.6',
    marginBottom: '10px',
    paddingLeft: '20px',
    listStyleType: 'disc',
  },
};

export default Experience;
